import React from 'react'
import { Route, Routes, Link } from 'react-router-dom'
import {BrowserRouter as Router} from 'react-router-dom'
// import './admin.css'

import AdminHome from './AdminHome';

import ViewMenu from './ViewMenu';
import Registration from '../Sellermenu/RegistrationMenu';

export default function AdminNavBar() 
{
  return (
    <div>

    <nav>
     <ul>
     <Link to="/" style={{color:"white"}}>Home</Link>
     <Link to="/ViewMenu" style={{color:"white"}}>View menu</Link>
     <Link to="/addmenu" style={{color:"white"}}>View menu</Link>
     </ul>
     </nav>

     <Routes>
  <Route path="/" element={<AdminHome />} exact />
  <Route path="/" element={<Registration/>} exact />
  <Route path="/ViewMenu" element={<ViewMenu />} exact />
</Routes>

    </div>
  )
}
